import React from 'react';
import {Line} from 'react-chartjs-2';

const LineGraph = ({historicalDeaths, historicalCases, historicalDates}) => {
    const arrayDates = [];
    const data = {
        labels: [() => { for(let i = 0; i<210; i = i + 10 ){
            arrayDates.push()
        }}],
        datasets: [
            {
                label: 'Total Deaths',
                fill: false,
                backgroundColor: 'rgba(75,192,192,0.4)',
                borderColor: 'rgba(75,192,192,1)',
                data: historicalDeaths
            },
            {
                label: 'Total Cases',
                fill: false,
                borderColor: 'rgba(180,60,70,1)',
                data: historicalCases
            }
        ]
    };
    return(
        <Line data={data}/>
    )


}

export default LineGraph;
